Менталитет? Для меня это не аргумент. Это всего лишь образ мыслей и установок закреплены восприятием человека. Кому-то проще следовать таким установкам  нежели включать мозг.
Почему то у всех принято понятие "Менталитет" употреблять в качестве оправдания🤔
